The Beretta 92G Brigadier Tactical Wilson Combat 9mm is a shooter’s dream come true.  Specs:  
Beretta/Wilson Combat 92G Brigadier Tactical, 9mm
Model: 92G Brigadier Tactical Wilson Combat
Receiver:  Steel
Finish: Blued Steel
Stock: G10 Dirty Olive grips with Wilson Combat Logo
             Medallion
Sights: Front:  Trijicon Tritium Dovetail
Rear:  Wilson Combat U-Notch Battlesight
Sight Radius:  6.5 inch
Barrel:  4.7 inch
Overall Length: 8.25 inch
Weight Empty:  36 oz.
Weight Loaded:  43 oz.
Capacity: 15 +1; 3 15 Round M9A1 Beretta Sand Resistant
  Magazines
Action: Double Action/Single Action
Safety: De-Cocker
Features: 
M9A1 frame with 92A1 Round Trigger Guard Profile and Improved Checkering;
Dehorned 92G Brigadier Slide;
Enhanced Slide to Frame Fit;
Stainless Barrel Finished in Black with Recessed Crown, 4.7” Elite II Length, Black Finish;
Oversized Steel Magazine Release;
Steel De-Cocking Levers;
Skeletonized Elite II Hammer;
D Hammer Spring;
Lanyard loop Pin;
Lanyard Loop, Aluminum; Steel Trigger;
Wilson Combat Fluted Steel Guide Rod;
Wilson Combat Logo on Slide;
All Steel Components (De-Cocker, Trigger, Magazine Release, Guide Rod);
Checkered Frontstrap and Backstrap;
Beveled Magazine Well;
Rail for Mounting Light or Laser;
Special Serial Number Range with W/C Prefix;
IDPA Stock Service Pistol Approved; and
USPSA Production Division Approved
